import React from 'react';
import {Link} from 'react-router-dom';

export default function Nav(){
    const navStyle = {
        color: 'lightcyan'
    }
    return (
        <nav>
            <h3>logo</h3>
            <ul className='nav-links'>
                <Link navStyle to='/'><li>Home</li></Link>
                <Link navStyle to='/user'><li>User</li></Link>
                <Link navStyle to='/review'><li>Review</li></Link>
                <Link navStyle to='/admin'><li>Administration</li></Link>
            </ul>
        </nav>
    );
}
